.
.
𝒾𝓃𝑔𝓇𝑒𝒹𝒾𝑒𝓃𝓉𝓈
1 cup oat flour 
1/2 tsp baking powder 
3/4 cup peanut butter
1/2 cup maple syrup 
1 tsp vanilla 
store bought jam (or homemade if you choose!)
.
.
preheat your oven to 350 degrees and line your cookie sheets with parchment paper. cream together the peanut butter, maple syrup and vanilla in a large bowl. then add in the oat flour and baking powder. continue to mix until full combined. roll dough into 20 balls and place on the cookie sheets. using a teaspoon press an indentation into each cookie. fill each indentation with jam and bake in the oven for 10-11 minutes. the cookies will look a little underdone but don't worry! 
.
